import "bootstrap/dist/css/bootstrap.min.css";
export default function Car({ car }) {
  console.log(car);

  return (
    <div className="container">
      <table className="table table-repsonsive">
        <tr>
          <th>Name</th>
          <th>Model</th>
          <th>Tip</th>
        </tr>
        <tr>
          <td>{car.name}</td>
          <td>{car.model}</td>
          <td>{car.type}</td>
        </tr>
      </table>
    </div>
  );
}
